import { useShowsContext } from "../../../contexts/ShowsConext";
import { ShowCard } from "../../shared/ShowCard/ShowCard";

export const NewestSeries = () => {
    const { seriesList, watchlist, styles, setWatchlist } = useShowsContext();
    console.log(seriesList);

    return (
        <section className={styles.section}>
            <div className={styles['title-wrapper']}>
                <div className={styles.devider}></div>
            <h2 className={styles.title}>Newest series</h2>
            <i className="fa-solid fa-angle-right"></i>
            </div>
            <div className={styles.series}>
                {seriesList.length > 0 ? seriesList.map(x =>
                    <ShowCard key={x.id} show={x.fields} id={x.id} watchlist={watchlist}/>)
                    : <p style={{ color: 'red', fontSize: '22px' }}>Nothing to show</p>}
            </div>
        </section>
    );
};
